import {List, ListItem, ListItemText} from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles';
import React from 'react';
import Tab from "./Tab.js";
import TabNav from "./Tab_Nav.js";
import {useState} from 'react';
import "./ScoreList.js";

const Item = withStyles(() => ({
	root: {
	  height: 20,
	  marginTop: 30,
	  backgroundColor: "#999999",
	  borderRadius: 8,
		Width: 1,
	},
}))(ListItem);

function ScoreList({scores, scope})
{  

	var scoreItems = [];
	const [selected, setSelected] = useState("User");
	if (scores != null)
	{
		for (let i = 0 ; i < scores.length; i++)
		{
			scoreItems.push(
				<Item>
					{scope === "global" ? <ListItemText primary={(i+1 + scores[i])}/>
					: <ListItemText primary= {(i+1) + "-\t\t" + scores[i]}/>}
				</Item>
			);
		}
		console.log("items");
		console.log(scoreItems);
	}
	else
		scoreItems.push("No score yet");

	return(
		<React.Fragment>			
		{"Best Scores"}
		<TabNav tabs={['User', 'World']} selected={ selected } setSelected={setSelected }>
		  <Tab isSelected={ selected === 'User'}>
				{scoreItems}
		  </Tab>
		  <Tab isSelected={ selected === 'World' }>
			<List>

			</List>
		  </Tab>
		</TabNav>
		</React.Fragment>
	)
}

export default ScoreList;
